import Persona from '../models/Persona';



export const createPersona = async () => {

try {
    const count = await Persona.estimatedDocumentCount();

  if (count > 0) return;

  const values = await Promise.all([
      new Persona({name: 'user'}).save()
  ])

  console.log(values);
  
} catch (error) {
  console.log(error);
}
}

